import React from 'react'

const Admin = () => {
  return (
    <main className='Admin'>
        <h2>Admin</h2>
        <p style={{ marginTop: '1rem' }}>
          This is the page of the admin app.<br/><br/>
        </p>
        <h1>Working in progress</h1>
    </main>
  )
}

export default Admin
